import { useState } from "react";

const [todo, setTodo] = useState("");
const todo_onChange = (e) => setTodo(e.target.value);

function App() {
  return (
    <form>
      <input type="text" value={todo} onChange={todo_onChange} />
    </form>
  );
}

export default App;
